window.bookSummaryJSON = "<p>The time has come to return to the Solis continent.<br> <br> With my mate at my side, my magic strong and fully born, Norivun and I venture back to the capital to fix all of the wrongs that have not yet been made right.<br> <br> But victory won’t come easily.<br> <br> Choices must be made.<br> <br> Lives will be lost.<br> <br> And in the end, only the true royals will rise.<br> <br> Crowns of Ice is the final book in Fae of Snow &amp; Ice, a four-book enemies-to-lovers fae fantasy romance series that takes place in Krista Street’s Supernatural World. This series contains steamy romance, a strong female fae who refuses to bow, a morally gray prince whose brutality knows no bounds, and a deadly tangle of royal strife and intrigue. Start listening to the epic conclusion today!</p>"; 
